import React from "react";

const BorrowedList = () => {
  const borrowed = [
    {
      student: "Student 1",
      title: "Book One",
      due: "2025-01-10",
      rating: 4,
    },
    {
      student: "Student 2",
      title: "Book Two",
      due: "2025-01-14",
      rating: 5,
    },
  ];

  return (
    <div style={{ padding: "20px" }}>
      <h2>Borrowed List</h2>

      <table border="1" width="100%" cellPadding="10">
        <thead>
          <tr>
            <th>Student Name</th>
            <th>Book Title</th>
            <th>Due Date</th>
            <th>Rating</th>
          </tr>
        </thead>

        <tbody>
          {borrowed.map((item, index) => (
            <tr key={index}>
              <td>{item.student}</td>
              <td>{item.title}</td>
              <td>{item.due}</td>
              <td>
                {"⭐".repeat(item.rating)}
                {"☆".repeat(5 - item.rating)}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default BorrowedList;
